pragma solidity ^0.8.0;

import "../utils/AccessControl.sol";

contract HasQuoteTokens is AccessControl {
  event QuoteTokenAdded(address indexed _QuoteToken);
  event QuoteTokenRemoved(address indexed _QuoteToken);

  address[] public QuoteTokens;
  mapping (address => bool) public QuoteToken;

  modifier onlyQuoteToken(address _addr) {
    require(QuoteToken[_addr]);
    _;
  }

  function addQuoteTokens(address[] memory _addedQuoteTokens) public onlyAdmin {
    address _QuoteToken;

    for (uint256 i = 0; i < _addedQuoteTokens.length; i++) {
      _QuoteToken = _addedQuoteTokens[i];

      if (!QuoteToken[_QuoteToken]) {
        QuoteTokens.push(_QuoteToken);
        QuoteToken[_QuoteToken] = true;
        emit QuoteTokenAdded(_QuoteToken);
      }
    }
  }

  function removeQuoteTokens(address[] memory _removedQuoteTokens) public onlyAdmin {
    address _QuoteToken;

    for (uint256 i = 0; i < _removedQuoteTokens.length; i++) {
      _QuoteToken = _removedQuoteTokens[i];

      if (QuoteToken[_QuoteToken]) {
        QuoteToken[_QuoteToken] = false;
        emit QuoteTokenRemoved(_QuoteToken);
      }
    }

    uint256 i = 0;

    while (i < QuoteTokens.length) {
      _QuoteToken = QuoteTokens[i];

      if (!QuoteToken[_QuoteToken]) {
        QuoteTokens[i] = QuoteTokens[QuoteTokens.length - 1];
        delete QuoteTokens[QuoteTokens.length - 1];
      } else {
        i++;
      }
    }
  }

  function isQuoteToken(address _addr) public view returns (bool) {
    return QuoteToken[_addr];
  }
}","keccak256":"0x2ce547b57165a0c9f2a2a92f96673bbd4b649bf4f563f20304f3379b24c99203"},"contracts/marketplace/Marketplace.sol":{"content":"// SPDX-License-Identifier: MIT OR Apache-2.0
pragma solidity ^0.8.3;

import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "./HasQuoteTokens.sol";

import "hardhat/console.sol";

contract Marketplace is ReentrancyGuard, HasQuoteTokens{
  using Counters for Counters.Counter;
  using SafeERC20 for IERC20;

  Counters.Counter private _itemIds;
  Counters.Counter private _itemsSold;
  // todo: mapping item to NFT contract and tokenID
  // todo: mapping tokenId to item onsale
  // todo: mapping tokneId to item array sold

  //  payable(address) can use .transfer(..) and .send(..) on address payable, but not on address

  struct MarketItem {
    uint itemId;
    // nft合约 
    address nftContract;
    // 出售的tokenID
    uint256 tokenId;
    // 出售者
    address seller;
    // todo: 所有者？
    address owner;
    // 价格
    uint256 price;
    // 计价单位
    address quoteTokenContract;
    // 已出售
    bool sold;
  }

  // itemId到信息映射
  mapping(uint256 => MarketItem) private idToMarketItem;

  event MarketItemCreated (
    uint indexed itemId,
    address indexed nftContract,
    uint256 indexed tokenId,
    address seller,
    address owner,
    uint256 price,
    address quoteTokenContract,
    bool sold
  );

  event CreateMarketSale (
    address indexed nftContract,
    address indexed buyer,
    uint256 indexed itemId
  );

//   /* Returns the listing price of the contract */
//   function getListingPrice() public view returns (uint256) {
//     return listingPrice;
//   }

  function createMarketItemByBNB(
    address nftContract,
    uint256 tokenId,
    uint256 price
  ) public nonReentrant
  {
    require(price > 0, "Price must be at least 1 wei");
    // require(msg.value == listingPrice, "Price must be equal to listing price");

    _itemIds.increment();
    uint256 itemId = _itemIds.current();

    idToMarketItem[itemId] =  MarketItem(
      itemId,
      nftContract,
      tokenId,
      msg.sender,
      address(0), // 挂售中，所有者为空
      price,
      address(0),
      false
    );

    IERC721(nftContract).transferFrom(msg.sender, address(this), tokenId);

    emit MarketItemCreated(
      itemId,
      nftContract,
      tokenId,
      msg.sender,
      address(0),
      price,
      address(0),
      false
    );
  }

  /* Places an item for sale on the marketplace */
  function createMarketItem(
    address nftContract,
    address quoteTokenContract,
    uint256 tokenId,
    uint256 price
  ) public onlyQuoteToken(quoteTokenContract) nonReentrant {
    require(price > 0, "Price must be at least 1 wei");

    _itemIds.increment();
    uint256 itemId = _itemIds.current();

    idToMarketItem[itemId] =  MarketItem(
      itemId,
      nftContract,
      tokenId,
      msg.sender,
      address(0),
      price,
      quoteTokenContract,
      false
    );

    IERC721(nftContract).transferFrom(msg.sender, address(this), tokenId);

    emit MarketItemCreated(
      itemId,
      nftContract,
      tokenId,
      msg.sender,
      address(0),
      price,
      quoteTokenContract,
      false
    );
  }

  function getQuoteTokenAddress(uint256 itemId) public view returns (address) {
      return idToMarketItem[itemId].quoteTokenContract;
  }

  function getPrice(uint256 itemId) public view returns (uint) {
      return idToMarketItem[itemId].price;
  }

  /* Creates the sale of a marketplace item */
  /* Transfers ownership of the item, as well as funds between parties */
  // warning： 转账之前由用户完成approve，approve(address to, uint256 tokenId)
  // 用户直接转账到买家
  // todo: 如果用户quoteTokenAddress不为0，则要先approve price数量代币转账权限
  function createMarketSale(
    address nftContract,
    uint256 itemId
  ) public payable nonReentrant {
    uint price = idToMarketItem[itemId].price;
    uint tokenId = idToMarketItem[itemId].tokenId;

    address quoteTokenContract = idToMarketItem[itemId].quoteTokenContract;
    if (quoteTokenContract == address(0)) {
        require(msg.value == price, "Please submit the asking price in order to complete the purchase");
        payable(idToMarketItem[itemId].seller).transfer(msg.value);
    } else {
        IERC20(quoteTokenContract).safeTransferFrom(msg.sender, idToMarketItem[itemId].seller, price);
    }

    IERC721(nftContract).transferFrom(address(this), msg.sender, tokenId);
    idToMarketItem[itemId].owner = payable(msg.sender);
    idToMarketItem[itemId].sold = true;
    _itemsSold.increment();

    emit CreateMarketSale(
      nftContract,
      msg.sender,
      itemId
    );
  }

  /* Returns all unsold market items */
  function fetchUnsoldItems() public view returns (MarketItem[] memory) {
    uint itemCount = _itemIds.current();
    uint unsoldItemCount = _itemIds.current() - _itemsSold.current();
    uint currentIndex = 0;

    MarketItem[] memory items = new MarketItem[](unsoldItemCount);
    for (uint i = 0; i < itemCount; i++) {
      if (idToMarketItem[i + 1].owner == address(0)) {
        uint currentId = i + 1;
        MarketItem storage currentItem = idToMarketItem[currentId];
        items[currentIndex] = currentItem;
        currentIndex += 1;
      }
    }
    return items;
  }

  /* Returns all sold market items */
  function fetchSoldItems() public view returns (MarketItem[] memory) {
    uint itemCount = _itemIds.current();
    uint unsoldItemCount = _itemIds.current() - _itemsSold.current();
    uint currentIndex = 0;

    MarketItem[] memory items = new MarketItem[](unsoldItemCount);
    for (uint i = 0; i < itemCount; i++) {
      if (idToMarketItem[i + 1].owner != address(0)) {
        uint currentId = i + 1;
        MarketItem storage currentItem = idToMarketItem[currentId];
        items[currentIndex] = currentItem;
        currentIndex += 1;
      }
    }
    return items;
  }

  /* Returns only items that a user's unsold */
  function fetchOnesUnsold(address _owner) public view returns (MarketItem[] memory) {
    uint totalItemCount = _itemIds.current();
    uint itemCount = 0;
    uint currentIndex = 0;

    for (uint i = 0; i < totalItemCount; i++) {
      if (idToMarketItem[i + 1].owner == _owner) {
        itemCount += 1;
      }
    }

    MarketItem[] memory items = new MarketItem[](itemCount);
    for (uint i = 0; i < totalItemCount; i++) {
      if (
        idToMarketItem[i + 1].seller == _owner &&
        idToMarketItem[i + 1].owner == address(0)
      ) 
      {
        uint currentId = i + 1;
        MarketItem storage currentItem = idToMarketItem[currentId];
        items[currentIndex] = currentItem;
        currentIndex += 1;
      }
    }
    return items;
  }

 /* Returns only items that a user's sold */
  function fetchOnesSold(address _owner) public view returns (MarketItem[] memory) {
    uint totalItemCount = _itemIds.current();
    uint itemCount = 0;
    uint currentIndex = 0;

    for (uint i = 0; i < totalItemCount; i++) {
      if (idToMarketItem[i + 1].owner == _owner) {
        itemCount += 1;
      }
    }

    MarketItem[] memory items = new MarketItem[](itemCount);
    for (uint i = 0; i < totalItemCount; i++) {
      if (
        idToMarketItem[i + 1].seller == _owner &&
        idToMarketItem[i + 1].owner != address(0)
      ) 
      {
        uint currentId = i + 1;
        MarketItem storage currentItem = idToMarketItem[currentId];
        items[currentIndex] = currentItem;
        currentIndex += 1;
      }
    }
    return items;
  }

  /* Returns only items that a user has purchased */
  function fetchTradeHistory(address _owner) public view returns (MarketItem[] memory) {
    uint totalItemCount = _itemIds.current();
    uint itemCount = 0;
    uint currentIndex = 0;

    for (uint i = 0; i < totalItemCount; i++) {
      if (idToMarketItem[i + 1].owner == _owner) {
        itemCount += 1;
      }
    }

    MarketItem[] memory items = new MarketItem[](itemCount);
    for (uint i = 0; i < totalItemCount; i++) {
      if (idToMarketItem[i + 1].owner == _owner) {
        uint currentId = i + 1;
        MarketItem storage currentItem = idToMarketItem[currentId];
        items[currentIndex] = currentItem;
        currentIndex += 1;
      }
    }
    return items;
  }

  /* Returns only items a user has created */
  function fetchItemsCreated() public view returns (MarketItem[] memory) {
    uint totalItemCount = _itemIds.current();
    uint itemCount = 0;
    uint currentIndex = 0;

    for (uint i = 0; i < totalItemCount; i++) {
      if (idToMarketItem[i + 1].seller == msg.sender) {
        itemCount += 1;
      }
    }

    MarketItem[] memory items = new MarketItem[](itemCount);
    for (uint i = 0; i < totalItemCount; i++) {
      if (idToMarketItem[i + 1].seller == msg.sender) {
        uint currentId = i + 1;
        MarketItem storage currentItem = idToMarketItem[currentId];
        items[currentIndex] = currentItem;
        currentIndex += 1;
      }
    }
    return items;
  }

  function getMarketItem(uint itemId) public view returns (MarketItem memory){
    return idToMarketItem[itemId];
  } 

  function withdrawNFT(address nftContract, address to_, uint tokenId_) public onlyOwner {
    IERC721(nftContract).transferFrom(address(this), to_, tokenId_);
  }
